        /// <summary>
        ///     Test file
        /// </summary>
        /// <param name="fileName"></param>
        /// <param name="encryptKeysString"></param>
        /// <param name="decryptKeysString"></param>
        /// <returns></returns>
        private FileModel TestFile(string fileName, string encryptKeysString, string decryptKeysString)
        {
            byte[] file = File.ReadAllBytes(@"..\..\..\Files\" + fileName);
            byte[] encryptKeys = Convert.FromBase64String(encryptKeysString);
            byte[] decryptKeys = Convert.FromBase64String(decryptKeysString);

            return _fileReaderService.ReadFile(file, encryptKeys, decryptKeys);
        }
